import React from "react";
import IntlMessages from "../../../../../util/IntlMessages";
import CardBox from "../../../../../components/CardBox/index";
import { connect } from "react-redux";
import ArchiveSchoolSession from "./ArchiveSchoolSession";
import SchoolSessionList from "./SchoolSessionList";
import { UncontrolledAlert } from "reactstrap";
import { addSchoolSession } from "../../../../../actions/SchoolSessionAction";
import AddSchoolSession from "./AddSchoolSession";
import { getSchoolSession } from "../../../../../actions/SchoolSessionAction";

class SchoolSession extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false,
      nameSchoolSession: "",
      start_date: "",
      end_date: "",
    };
    this.openAddModal = this.openAddModal.bind(this);
    this.handleCancel = this.handleCancel.bind(this);
    this.openAddModal = this.openAddModal.bind(this);
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleArchive = this.handleArchive.bind(this);
  }
  componentDidMount() {
    this.props.dispatch(
      getSchoolSession(
        this.props.userProfile.establishment_id,
        this.props.userProfile.school_year_id
      )
    );
  }
  componentDidUpdate(prevProps) {
    if (prevProps.userProfile !== this.props.userProfile) {
      this.props.dispatch(
        getSchoolSession(
          this.props.userProfile.establishment_id,
          this.props.userProfile.school_year_id
        )
      );
    }
  }

  handleCancel() {
    this.setState({ isOpen: false });
  }
  openAddModal() {
    this.setState({ isOpen: true });
  }
  openAddModal() {
    this.setState((previousState) => ({
      isOpen: !previousState.isOpen,
    }));
  }
  handleSubmit(event) {
    event.preventDefault();
    let data = {
      name: this.state.nameSchoolSession,
      start_date: this.state.start_date,
      end_date: this.state.end_date,
      fk_id_school_year: this.props.userProfile.school_year_id,
      fk_id_establishment: this.props.userProfile.establishment_id,
    };
    this.props.dispatch(addSchoolSession(data));
    this.openAddModal();
    this.setState({ nameSchoolSession: "" });
  }

  handleArchive(event) {
    event.preventDefault();
    this.openAddModal();
    this.setState({});
  }
  handleChange = (name) => (event) => {
    this.setState({ [name]: event.target.value });
  };

  render() {
    return (
      <div
        className="app-wrapper"
        style={{
          marginLeft: "5%",
          marginRight: "10%",
        }}
      >
        <div className="  d-flex flex-column mb-3">
          <div className="p-2 bd-highlight" style={{ marginLeft: "4%" }}>
            <h1>
              <b>
                <IntlMessages id="sidebar.components.schoolSession" />
              </b>
            </h1>
          </div>
          {this.props.successStatus ? (
            <UncontrolledAlert className="alert-addon-card bg-success bg-success text-white shadow-lg">
              <span className="icon-addon alert-addon">
                <i className="zmdi zmdi-cloud-done zmdi-hc-fw zmdi-hc-lg" />
              </span>
              <span className="d-inline-block"> {this.props.message} </span>
            </UncontrolledAlert>
          ) : (
            ""
          )}
          <div className=" bd-highlight" style={{ width: "90%" }}>
            <CardBox styleName="col-lg-12">
              <SchoolSessionList schoolSessions={this.props.schoolSessions} />
            </CardBox>
          </div>
        </div>
        <div className=" bd-highlight" style={{ width: "90%" }}>
          <CardBox styleName="col-lg-12">
            <ArchiveSchoolSession />
          </CardBox>
        </div>
        <div className=" bd-highlight" style={{ width: "90%" }}>
          <CardBox styleName="col-lg-12">
            <AddSchoolSession
              openAddModal={this.openAddModal}
              handleCancel={this.handleCancel}
              handleChange={this.handleChange}
              handleSubmit={this.handleSubmit}
              handleArchive={this.handleArchive}
              values={this.state}
            />
          </CardBox>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    userProfile: state.auth.userProfile,
    schoolSessions: state.schoolSessionReducer.schoolSessions,
  };
};

export default connect(mapStateToProps)(SchoolSession);
